import React from 'react';
import '../App.css';


const Homepage = (props) => {
    return (
        <div>
            <div className="banner">
                <h1 style={{color:'white', fontSize:'50px'}}>Res-happy</h1>
            </div>
            <div>
            <h3>Let's get cooking!</h3>
            </div>
        </div>
    );
}

export default Homepage;
